    console.log(nameTrimmed);

    return (
      <div>
        <div className="row">
          <div className="col-md-12">
            <div className="card card-body m-auto bg-light">
              <p className="text-info h4 text-center ">User's Bio</p>
              {}
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default ProfileAbout;
